import AwToolbar from 'viewmodel/AwToolbarViewModel';

/**
 * render function for Common Global Navigation
 * @param {*} param0 context for render function interpolation
 * @returns {JSX.Element} react component
 */
export const commonGlobalNavigationBarRenderFunction = () => {
    return (
        <div className='sw-row flex-auto'>
